import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

import LocalDate from './components/LocalDate.js'


ReactDOM.render(<App />,
  document.getElementById('root')
);

ReactDOM.render(<LocalDate date= {new Date()}/>,
  document.getElementById('root')
);
